import React from 'react'
import styled from 'styled-components'

function profile() {
    return (
        <div style={{height:'100vh'}}>
            <h1>Profile Page</h1>
            <Button/>
        </div>
    )
}

const Button = styled.button`
    // padding:50px;
    height:30px;
    width:50px;
`

export default profile
